import { NextRequest, NextResponse } from 'next/server'
import { getDb } from '@/lib/mongodb'
import { comparePassword, generateToken } from '@/lib/auth'

export async function POST(request: NextRequest) {
  try {
    const { email, password, rememberMe = false } = await request.json()

    if (!email || !password) {
      return NextResponse.json({ error: 'Email and password required' }, { status: 400 })
    }

    const db = await getDb()

    // Find user by email
    const user = await db.collection('users').findOne({ email })

    if (!user) {
      return NextResponse.json({ error: 'Invalid credentials' }, { status: 401 })
    }

    // Check if user is active
    if (!user.isActive) {
      return NextResponse.json({ error: 'Account is disabled' }, { status: 401 })
    }

    // Verify password
    const isValidPassword = await comparePassword(password, user.password)

    if (!isValidPassword) {
      return NextResponse.json({ error: 'Invalid credentials' }, { status: 401 })
    }

    // Generate token
    const token = generateToken({
      userId: user._id.toString(),
      email: user.email,
      username: user.username,
      isAdmin: user.isAdmin || false
    }, rememberMe)

    const response = NextResponse.json({
      success: true,
      user: {
        id: user._id.toString(),
        username: user.username,
        email: user.email,
        points: user.points,
        isAdmin: user.isAdmin || false,
        lifelines: user.lifelines
      }
    })

    // Set cookie
    response.cookies.set('auth-token', token, {
      httpOnly: true,
      secure: process.env.NODE_ENV === 'production',
      sameSite: 'lax',
      maxAge: rememberMe ? 30 * 24 * 60 * 60 : 24 * 60 * 60,
      path: '/'
    })

    return response

  } catch (error) {
    console.error('Login error:', error)
    return NextResponse.json({ error: 'Login failed' }, { status: 500 })
  }
}

import { NextRequest, NextResponse } from 'next/server'
import { getDb } from '@/lib/mongodb'
import { hashPassword, generateToken } from '@/lib/auth'

export async function POST(request: NextRequest) {
  try {
    const body = await request.json()
    const { name, email, password } = body

    if (!name || !email || !password) {
      return NextResponse.json({ error: 'Missing required fields' }, { status: 400 })
    }

    if (password.length < 8) {
      return NextResponse.json({ error: 'Password must be at least 8 characters' }, { status: 400 })
    }

    const db = await getDb()

    // Check if user exists
    const existingUser = await db.collection('users').findOne({ 
      $or: [{ email }, { username: name }] 
    })

    if (existingUser) {
      return NextResponse.json({ error: 'User already exists' }, { status: 400 })
    }

    // Get all lifelines to assign to new user
    const lifelines = await db.collection('lifelines').find().toArray()
    const userLifelines = lifelines.map(l => ({
      lifelineId: l._id,
      name: l.name,
      remaining_uses: l.max_uses
    }))

    // Create new user
    const hashedPassword = await hashPassword(password)
    const userId = new Date().getTime().toString()

    const newUser = {
      _id: userId as any,
      username: name,
      email,
      password: hashedPassword,
      points: 100,
      isActive: true,
      isAdmin: false,
      lifelines: userLifelines,
      history: {
        lifeline_usage: [],
        gambling: []
      },
      createdAt: new Date(),
      updatedAt: new Date()
    }

    await db.collection('users').insertOne(newUser)

    // Generate token
    const token = generateToken({
      userId: newUser._id,
      email: newUser.email,
      username: newUser.username,
      isAdmin: false
    })

    const response = NextResponse.json({
      success: true,
      user: {
        id: newUser._id.toString(),
        username: newUser.username,
        email: newUser.email,
        points: newUser.points,
        isAdmin: false,
        lifelines: newUser.lifelines
      }
    })

    response.cookies.set('auth-token', token, {
      httpOnly: true,
      secure: process.env.NODE_ENV === 'production',
      sameSite: 'lax',
      maxAge: 24 * 60 * 60,
      path: '/'
    })

    return response

  } catch (error) {
    console.error('Registration error:', error)
    return NextResponse.json({ 
      error: 'Registration failed', 
      details: error instanceof Error ? error.message : 'Unknown error' 
    }, { status: 500 })
  }
}

import { NextRequest, NextResponse } from 'next/server'
import { getDb } from '@/lib/mongodb'
import { verifyToken } from '@/lib/auth'
import { ObjectId } from 'mongodb'

export async function GET(request: NextRequest) {
  try {
    const token = request.cookies.get('auth-token')?.value

    if (!token) {
      return NextResponse.json({ error: 'Not authenticated' }, { status: 401 })
    }

    const payload = verifyToken(token)

    if (!payload) {
      return NextResponse.json({ error: 'Invalid token' }, { status: 401 })
    }

    const db = await getDb()
    let user

    try {
      // Try as ObjectId first if it looks like one
      if (ObjectId.isValid(payload.userId)) {
        user = await db.collection('users').findOne({ _id: new ObjectId(payload.userId) })
      } else {
        // Use as string ID
        user = await db.collection('users').findOne({ _id: payload.userId as any })
      }
    } catch {
      // Fallback to string search
      user = await db.collection('users').findOne({ _id: payload.userId as any })
    }

    // Fallback: try finding by username if ID doesn't match
    if (!user) {
      user = await db.collection('users').findOne({ username: payload.username })
    }

    if (!user) {
      return NextResponse.json({ error: 'User not found' }, { status: 401 })
    }

    if (!user.isActive) {
      return NextResponse.json({ error: 'Account disabled' }, { status: 401 })
    }

    return NextResponse.json({
      user: {
        id: user._id.toString(),
        username: user.username,
        email: user.email,
        points: user.points,
        isAdmin: user.isAdmin || false,
        lifelines: user.lifelines
      }
    })

  } catch (error) {
    console.error('Auth check error:', error)
    return NextResponse.json({ error: 'Authentication failed' }, { status: 500 })
  }
}

