const PAYOUTS = {
  '💎💎💎': 500,  // Jackpot
  '⭐⭐⭐': 200,   // Triple star
  '🍒🍒🍒': 100,  // Triple cherry
  '🍇🍇🍇': 80,   // Triple grape
  '🍊🍊🍊': 60,   // Triple orange
  '🍋🍋🍋': 40,   // Triple lemon
  '💎💎': 50,     // Double diamond
  '⭐⭐': 30,      // Double star
  '🍒🍒': 20,     // Double cherry
}

function spinSlots() {
  const result = [
    SLOT_SYMBOLS[Math.floor(Math.random() * SLOT_SYMBOLS.length)],
    SLOT_SYMBOLS[Math.floor(Math.random() * SLOT_SYMBOLS.length)],
    SLOT_SYMBOLS[Math.floor(Math.random() * SLOT_SYMBOLS.length)]
  ]

  const resultString = result.join('')
  let payout = 0
  let outcome = 'lose'

  // Check for wins
  if ((PAYOUTS as any)[resultString]) {
    payout = (PAYOUTS as any)[resultString]
    outcome = 'win'
  } else {
    // Check for doubles
    const doubleKey = result[0] + result[1]
    if (result[0] === result[1] && (PAYOUTS as any)[doubleKey]) {
      payout = (PAYOUTS as any)[doubleKey]
      outcome = 'small_win'
    }
  }

  return { result, payout, outcome }
}

