      return NextResponse.json({ error: 'Not authenticated' }, { status: 401 })
    }

    const payload = verifyToken(token)
    if (!payload) {
      return NextResponse.json({ error: 'Invalid token' }, { status: 401 })
    }

    // Rate limiting: 30 spins per minute
    const rateLimitResult = rateLimit(`slot_${payload.userId}`, 30, 60000)
    if (!rateLimitResult.success) {
      return NextResponse.json({ 
        error: 'Rate limit exceeded. Try again later.',
        resetTime: rateLimitResult.resetTime
      }, { status: 429 })
    }

    const db = await getDb()
    const user = await db.collection('users').findOne({ _id: payload.userId as any })

    if (!user) {
      return NextResponse.json({ error: 'User not found' }, { status: 404 })
    }

    if (user.points < SLOT_COST) {
      return NextResponse.json({ error: 'Insufficient points' }, { status: 400 })
    }

    // Spin the slots
    const { result, payout, outcome } = spinSlots()
    const newPoints = user.points - SLOT_COST + payout

    // Update user points and history
    const historyEntry = {
      game: 'slot_machine',
      points_spent: SLOT_COST,
      outcome,
      points_won: payout,
      timestamp: new Date()
    }

    await db.collection('users').updateOne(
      { _id: payload.userId as any },
      {
        $set: {
          points: newPoints,
          updatedAt: new Date()
        },
        $push: {
          'history.gambling': historyEntry as any
        }
      }
    )

    // Log in gamblelog
    await db.collection('gamblelog').insertOne({
      _id: new Date().getTime().toString() as any,
      userId: payload.userId,
      game: 'slot_machine',
      points_spent: SLOT_COST,
      outcome,
      details: {
        result,
        payout
      },
      timestamp: new Date()
    })

    return NextResponse.json({
      success: true,
      result,
      payout,
      outcome,
      newPoints,
      remaining: rateLimitResult.remaining,
      message: payout > 0 ? `You won ${payout} points!` : 'Better luck next time!'
    })

  } catch (error) {
    console.error('Slot machine error:', error)
    return NextResponse.json({ error: 'Slot machine failed' }, { status: 500 })
  }
}

import { NextRequest, NextResponse } from 'next/server'
import { getDb } from '@/lib/mongodb'
import { verifyToken } from '@/lib/auth'
import { rateLimit } from '@/lib/rate-limit'

const SCRATCH_COST = 20

export async function POST(request: NextRequest) {
  try {
    const token = request.cookies.get('auth-token')?.value
    if (!token) {
      return NextResponse.json({ error: 'Not authenticated' }, { status: 401 })
    }

    const payload = verifyToken(token)
    if (!payload) {
      return NextResponse.json({ error: 'Invalid token' }, { status: 401 })
    }

    // Rate limiting: 20 scratches per minute
    const rateLimitResult = rateLimit(`scratch_${payload.userId}`, 20, 60000)
    if (!rateLimitResult.success) {
      return NextResponse.json({ 
        error: 'Rate limit exceeded. Try again later.',
        resetTime: rateLimitResult.resetTime
      }, { status: 429 })
    }

    const { position } = await request.json()
    if (position < 0 || position > 8) {
      return NextResponse.json({ error: 'Invalid position' }, { status: 400 })
    }

    const db = await getDb()
    const user = await db.collection('users').findOne({ _id: payload.userId as any })

    if (!user) {
      return NextResponse.json({ error: 'User not found' }, { status: 404 })
    }

    if (user.points < SCRATCH_COST) {
      return NextResponse.json({ error: 'Insufficient points' }, { status: 400 })
    }

    // Generate 3x3 grid (60% penalty, 40% powerup chance)
    const grid = Array(9).fill(null).map(() => Math.random() < 0.4 ? 'powerup' : 'penalty')
    const result = grid[position]

    let powerups: any[] = []
    if (result === 'powerup') {
      // Get available FOR powerups
      powerups = await db.collection('lifelines').find({ 
        type: 'FOR', 
        isActive: true 
      }).toArray()
    }

    // Deduct points
    const newPoints = user.points - SCRATCH_COST

    await db.collection('users').updateOne(
      { _id: payload.userId as any },
      {
        $set: {
          points: newPoints,
          updatedAt: new Date()
        },
        $push: {
          'history.gambling': {
            game: 'scratch_strike',
            points_spent: SCRATCH_COST,
            outcome: result,
            position,
            timestamp: new Date()
          } as any
        }
      }
    )

    // Log in gamblelog
    await db.collection('gamblelog').insertOne({
      _id: new Date().getTime().toString() as any,
      userId: payload.userId,
      game: 'scratch_strike',
      points_spent: SCRATCH_COST,
      outcome: result,
      details: {
        position,
        grid
      },
      timestamp: new Date()
    })

    return NextResponse.json({
      success: true,
      result,
      position,
      grid,
      powerups: result === 'powerup' ? powerups : [],
      newPoints,
      remaining: rateLimitResult.remaining,
      message: result === 'powerup' ? 'You found a powerup!' : 'Better luck next time!'
    })

  } catch (error) {
    console.error('Scratch Strike error:', error)
    return NextResponse.json({ error: 'Scratch Strike failed' }, { status: 500 })
  }
}

import { NextRequest, NextResponse } from 'next/server'
import { getDb } from '@/lib/mongodb'
import { verifyToken } from '@/lib/auth'

export async function POST(request: NextRequest) {
  try {
    const token = request.cookies.get('auth-token')?.value
    if (!token) {
      return NextResponse.json({ error: 'Not authenticated' }, { status: 401 })
    }

    const payload = verifyToken(token)
    if (!payload) {
      return NextResponse.json({ error: 'Invalid token' }, { status: 401 })
    }

    const { powerupId } = await request.json()
    if (!powerupId) {
      return NextResponse.json({ error: 'Powerup ID required' }, { status: 400 })
    }

    const db = await getDb()
    const user = await db.collection('users').findOne({ _id: payload.userId as any })
    const powerup = await db.collection('lifelines').findOne({ 
      _id: powerupId, 
      type: 'FOR', 
      isActive: true 
    })

    if (!user || !powerup) {
      return NextResponse.json({ error: 'User or powerup not found' }, { status: 404 })
    }

    // Check if user already has this powerup
    const existingPowerup = user.lifelines.find((l: any) => l.lifelineId === powerupId)

    if (existingPowerup) {
      // Add uses to existing powerup (max 1 additional use)
      await db.collection('users').updateOne(
        { _id: payload.userId as any, 'lifelines.lifelineId': powerupId },
        {
          $inc: {
            'lifelines.$.remaining_uses': 1
          },
          $set: {
            updatedAt: new Date()
          }
        }
      )
    } else {
      // Add new powerup to user
      await db.collection('users').updateOne(
        { _id: payload.userId as any },
        {
          $push: {
            lifelines: {
              lifelineId: powerupId,
              name: powerup.name,
              remaining_uses: 1
            } as any
          },
          $set: {
            updatedAt: new Date()
          }
        }
      )
    }

    // Log the powerup claim
    await db.collection('gamblelog').insertOne({
      _id: new Date().getTime().toString() as any,
      userId: payload.userId,
      game: 'scratch_claim',
      points_spent: 0,
      outcome: 'powerup_claimed',
      details: {
        powerupName: powerup.name,
        powerupId
      },
      timestamp: new Date()
    })

    return NextResponse.json({
      success: true,
      powerup: {
        id: powerupId,
        name: powerup.name,
        description: powerup.description
      },
      message: `${powerup.name} added to your account!`
    })

  } catch (error) {
    console.error('Powerup claim error:', error)
    return NextResponse.json({ error: 'Failed to claim powerup' }, { status: 500 })
  }
}

import { MongoClient, ObjectId } from 'mongodb'

if (!process.env.MONGODB_CONNECTION_URI) {
  throw new Error('Please add your MongoDB URI to .env')
}

const uri = process.env.MONGODB_CONNECTION_URI
const options = {}

let client: MongoClient
let clientPromise: Promise<MongoClient>

if (process.env.NODE_ENV === 'development') {
  let globalWithMongo = global as typeof globalThis & {
    _mongoClientPromise?: Promise<MongoClient>
  }

  if (!globalWithMongo._mongoClientPromise) {
    client = new MongoClient(uri, options)
    globalWithMongo._mongoClientPromise = client.connect()
  }
  clientPromise = globalWithMongo._mongoClientPromise
} else {
  client = new MongoClient(uri, options)
  clientPromise = client.connect()
}

export default clientPromise

export async function getDb() {
  const client = await clientPromise
  return client.db('code')
}

// Helper function to find user by ID (handles both ObjectId and string)
export async function findUserById(userId: string) {
  const db = await getDb()
  try {
    // Try as ObjectId first
    if (ObjectId.isValid(userId)) {
      const user = await db.collection('users').findOne({ _id: new ObjectId(userId) })
      if (user) return user
    }
    // Fallback to string
    return await db.collection('users').findOne({ _id: userId as any })
  } catch {
    return await db.collection('users').findOne({ _id: userId as any })
  }
}

import jwt from 'jsonwebtoken'
import bcrypt from 'bcrypt'

const JWT_SECRET = process.env.JWT_SECRET!

export interface UserPayload {
  userId: string
  email: string
  username: string
  isAdmin?: boolean
}

export function generateToken(user: UserPayload, rememberMe = false): string {
  return jwt.sign(
    user,
    JWT_SECRET,
    { expiresIn: rememberMe ? '30d' : '24h' }
  )
}

export function verifyToken(token: string): UserPayload | null {
  try {
    return jwt.verify(token, JWT_SECRET) as UserPayload
  } catch {
    return null
  }
}

export async function hashPassword(password: string): Promise<string> {
  return bcrypt.hash(password, parseInt(process.env.BCRYPT_ROUNDS || '12'))
}

export async function comparePassword(password: string, hash: string): Promise<boolean> {
  return bcrypt.compare(password, hash)
}

interface RateLimitStore {
  [key: string]: {
    count: number
    resetTime: number
  }
}

const store: RateLimitStore = {}

export function rateLimit(
  identifier: string,
  maxRequests: number = 10,
  windowMs: number = 60000 // 1 minute
): { success: boolean; remaining: number; resetTime: number } {
  const now = Date.now()
  const key = identifier

  // Clean up expired entries
  if (store[key] && now > store[key].resetTime) {
    delete store[key]
  }

  // Initialize or get current data
  if (!store[key]) {
    store[key] = {
      count: 0,
      resetTime: now + windowMs
    }
  }

  const current = store[key]

  // Check if limit exceeded
  if (current.count >= maxRequests) {
    return {
      success: false,
      remaining: 0,
      resetTime: current.resetTime
    }
  }

  // Increment counter
  current.count++

  return {
    success: true,
    remaining: maxRequests - current.count,
    resetTime: current.resetTime
  }
}

