export async function POST(request: NextRequest) {
  try {
    const token = request.cookies.get('auth-token')?.value
    if (!token) {
      return NextResponse.json({ error: 'Not authenticated' }, { status: 401 })
    }

    const payload = verifyToken(token)
    if (!payload || !payload.isAdmin) {
      return NextResponse.json({ error: 'Admin access required' }, { status: 403 })
    }

    const { userId, powerupId } = await request.json()

    if (!userId || !powerupId) {
      return NextResponse.json({ error: 'Missing userId or powerupId' }, { status: 400 })
    }

    const db = await getDb()

    // Get target user and powerup
    const user = await db.collection('users').findOne({ _id: userId as any })
    const powerup = await db.collection('lifelines').findOne({ _id: powerupId })

    if (!user) {
      return NextResponse.json({ error: 'User not found' }, { status: 404 })
    }

    if (!powerup || powerup.type !== 'AGAINST' || !powerup.admin_only) {
      return NextResponse.json({ error: 'Invalid AGAINST powerup' }, { status: 404 })
    }

    // Check if user has enough points
    if (user.points < powerup.point_cost) {
      return NextResponse.json({ error: 'User has insufficient points' }, { status: 400 })
    }

    // Calculate point deductions
    let totalPointsDeducted = powerup.point_cost
    if (powerup.points_deducted) {
      totalPointsDeducted += powerup.points_deducted
    }

    const newPoints = Math.max(0, user.points - totalPointsDeducted)

    // Update user points
    await db.collection('users').updateOne(
      { _id: userId as any },
      {
        $set: {
          points: newPoints,
          updatedAt: new Date()
        },
        $push: {
          'history.lifeline_usage': {
            lifelineId: powerupId,
            name: powerup.name,
            points_spent: totalPointsDeducted,
            timestamp: new Date(),
            admin_triggered: true
          } as any
        }
      }
    )

    // Log the admin action
    await db.collection('gamblelog').insertOne({
      _id: new Date().getTime().toString() as any,
      userId: userId,
      game: 'admin_powerup',
      points_spent: totalPointsDeducted,
      outcome: 'triggered',
      details: {
        adminId: payload.userId,
        adminUsername: payload.username,
        powerupName: powerup.name,
        powerupId,
        type: powerup.type,
        duration: powerup.duration_seconds,
        timer_reduction: powerup.timer_reduction || 0,
        points_deducted: powerup.points_deducted || 0
      },
      timestamp: new Date()
    })

    return NextResponse.json({
      success: true,
      powerup: {
        id: powerupId,
        name: powerup.name,
        type: powerup.type,
        duration: powerup.duration_seconds,
        timer_reduction: powerup.timer_reduction || 0
      },
      user: {
        id: userId,
        username: user.username,
        oldPoints: user.points,
        newPoints,
        pointsDeducted: totalPointsDeducted
      },
      message: `${powerup.name} triggered on ${user.username}`
    })

  } catch (error) {
    console.error('Admin powerup trigger error:', error)
    return NextResponse.json({ error: 'Failed to trigger powerup' }, { status: 500 })
  }
}

import { NextRequest, NextResponse } from 'next/server'
import { getDb } from '@/lib/mongodb'

export async function GET(request: NextRequest) {
  try {
    const { searchParams } = new URL(request.url)
    const limit = parseInt(searchParams.get('limit') || '10')

    const db = await getDb()

    // Get top users by points
    const topUsers = await db.collection('users')
      .find({ isActive: true })
      .sort({ points: -1 })
      .limit(limit)
      .project({
        _id: 1,
        username: 1,
        points: 1,
        createdAt: 1,
        'history.lifeline_usage': 1,
        'history.gambling': 1
      })
      .toArray()

    // Calculate additional stats for each user
    const leaderboard = topUsers.map((user, index) => {
      const lifelinesUsed = user.history?.lifeline_usage?.length || 0
      const gamesPlayed = user.history?.gambling?.length || 0
      const totalSpent = [
        ...(user.history?.lifeline_usage || []),
        ...(user.history?.gambling || [])
      ].reduce((sum, item) => sum + (item.points_spent || item.points_bet || 0), 0)

      return {
        rank: index + 1,
        username: user.username,
        points: user.points,
        lifelinesUsed,
        gamesPlayed,
        totalSpent,
        joinedAt: user.createdAt
      }
    })

    return NextResponse.json({
      leaderboard,
      totalUsers: await db.collection('users').countDocuments({ isActive: true })
    })

  } catch (error) {
    console.error('Leaderboard fetch error:', error)
    return NextResponse.json({ error: 'Failed to fetch leaderboard' }, { status: 500 })
  }
}

import { NextRequest, NextResponse } from 'next/server'
import { getDb } from '@/lib/mongodb'
import { verifyToken } from '@/lib/auth'

export async function GET(request: NextRequest) {
  try {
    const token = request.cookies.get('auth-token')?.value
    if (!token) {
      return NextResponse.json({ error: 'Not authenticated' }, { status: 401 })
    }

    const payload = verifyToken(token)
    if (!payload) {
      return NextResponse.json({ error: 'Invalid token' }, { status: 401 })
    }

    const { searchParams } = new URL(request.url)
    const type = searchParams.get('type') // 'all', 'lifelines', 'gambling'
    const limit = parseInt(searchParams.get('limit') || '50')

    const db = await getDb()

    // Get user's history from user document
    const user = await db.collection('users').findOne({ _id: payload.userId as any })
    if (!user) {
      return NextResponse.json({ error: 'User not found' }, { status: 404 })
    }

    let history: any[] = []

    if (type === 'lifelines' || type === 'all') {
      const lifelineHistory = (user.history?.lifeline_usage || []).map((item: any) => ({
        ...item,
        type: 'lifeline',
        id: `lifeline_${item.timestamp}`
      }))
      history.push(...lifelineHistory)
    }

    if (type === 'gambling' || type === 'all') {
      const gamblingHistory = (user.history?.gambling || []).map((item: any) => ({
        ...item,
        type: 'gambling',
        id: `gambling_${item.timestamp}`
      }))
      history.push(...gamblingHistory)
    }

    // Sort by timestamp (newest first) and limit
    history.sort((a, b) => new Date(b.timestamp).getTime() - new Date(a.timestamp).getTime())
    history = history.slice(0, limit)

    // Get stats
    const stats = {
      totalLifelinesUsed: user.history?.lifeline_usage?.length || 0,
      totalGamblingGames: user.history?.gambling?.length || 0,
      totalPointsSpent: [
        ...(user.history?.lifeline_usage || []),
        ...(user.history?.gambling || [])
      ].reduce((sum, item) => sum + (item.points_spent || item.points_bet || 0), 0),
      totalPointsWon: (user.history?.gambling || []).reduce((sum: number, item: any) => sum + (item.points_won || 0), 0)
    }

    return NextResponse.json({
      history,
      stats,
      currentPoints: user.points
    })

  } catch (error) {
    console.error('History fetch error:', error)
    return NextResponse.json({ error: 'Failed to fetch history' }, { status: 500 })
  }
}

