'use client'

import { useState, useEffect } from 'react'
import { X, AlertTriangle } from 'lucide-react'
import { motion, AnimatePresence } from 'framer-motion'

interface SabotageNotification {
  id: string
  attackerUsername: string
  sabotage: string
  pointsDeducted: number
  duration: number
  timestamp: string
}

interface SabotageNotificationProps {
  userId: string
}

export default function SabotageNotificationComponent({ userId }: SabotageNotificationProps) {
  const [notifications, setNotifications] = useState<SabotageNotification[]>([])
  const [lastCheck, setLastCheck] = useState<string>(new Date().toISOString())

  useEffect(() => {
    if (!userId) return

    const checkForSabotages = async () => {
      try {
        const response = await fetch(`/api/sabotage/notifications?since=${lastCheck}`, {
          credentials: 'include'
        })

        if (response.ok) {
          const data = await response.json()
          if (data.sabotages.length > 0) {
            setNotifications(prev => [...data.sabotages, ...prev])
            setLastCheck(new Date().toISOString())
          }
        }
      } catch (error) {
        console.error('Failed to check sabotage notifications:', error)
      }
    }

    // Check immediately
    checkForSabotages()

    // Then check every 3 seconds
    const interval = setInterval(checkForSabotages, 3000)
    return () => clearInterval(interval)
  }, [userId, lastCheck])

  const dismissNotification = (id: string) => {
    setNotifications(prev => prev.filter(n => n.id !== id))
  }

  return (
    <div className="fixed top-4 right-4 z-50 space-y-3">
      <AnimatePresence>
        {notifications.map((notification) => (
          <motion.div
            key={notification.id}
            initial={{ opacity: 0, x: 300, scale: 0.8 }}
            animate={{ opacity: 1, x: 0, scale: 1 }}
            exit={{ opacity: 0, x: 300, scale: 0.8 }}
            className="bg-red-500/20 backdrop-blur-xl border border-red-500/30 rounded-2xl p-4 max-w-sm shadow-2xl"
          >
            <div className="flex items-start justify-between">
              <div className="flex items-start space-x-3">
                <div className="w-10 h-10 bg-red-500/30 rounded-xl flex items-center justify-center">
                  <AlertTriangle className="w-5 h-5 text-red-400" />
                </div>
                <div className="flex-1">
                  <h4 className="text-red-400 font-bold text-sm">You've been sabotaged!</h4>
                  <p className="text-white text-sm">
                    <span className="font-semibold">{notification.attackerUsername}</span> used{' '}
                    <span className="text-red-300">{notification.sabotage}</span> on you
                  </p>
                  {notification.pointsDeducted > 0 && (
                    <p className="text-red-300 text-xs mt-1">
                      -{notification.pointsDeducted} points deducted
                    </p>
                  )}
                  {notification.duration > 0 && (
                    <p className="text-orange-300 text-xs">
                      Effect lasts {notification.duration}s
                    </p>
                  )}
                </div>
              </div>
              <button
                onClick={() => dismissNotification(notification.id)}
                className="text-white/60 hover:text-white transition-colors p-1"
              >
                <X className="w-4 h-4" />
              </button>
            </div>
          </motion.div>
        ))}
      </AnimatePresence>
    </div>
  )
}

