  .find({})
  .sort({ timestamp: -1 })
  .skip(skip)
  .limit(Math.floor(limit / 2))
  .toArray()

const recentSabotages = await db.collection('sabotages')
  .find({})
  .sort({ timestamp: -1 })
  .skip(skip)
  .limit(Math.floor(limit / 2))
  .toArray()

// Combine and sort all activities
const combinedActivity = [
  ...recentActivity.map(a => ({ ...a, source: 'gamblelog' })),
  ...recentSabotages.map(s => ({ 
    ...s, 
    source: 'sabotages',
    userId: s.attackerId,
    game: 'sabotage',
    points_spent: s.pointsSpent,
    outcome: 'sabotaged'
  }))
].sort((a, b) => new Date(b.timestamp).getTime() - new Date(a.timestamp).getTime())
  .slice(0, limit)

// Get user details for each activity
const userIds = [...new Set(combinedActivity.map(activity => activity.userId))]
const users = await db.collection('users')
  .find({ _id: { $in: userIds } })
  .project({ _id: 1, username: 1 })
  .toArray()

const userMap = users.reduce((map, user) => {
  map[user._id] = user.username
  return map
}, {} as Record<string, string>)

const activityWithUsers = combinedActivity.map(activity => ({
  ...activity,
  username: userMap[activity.userId] || 'Unknown',
  id: activity._id
}))

return NextResponse.json({
  activity: activityWithUsers,
  pagination: {
    page,
    limit,
    total: totalCount + sabotageCount,
    totalPages: Math.ceil((totalCount + sabotageCount) / limit)
  },
  totalActivities: totalCount + sabotageCount
})

